import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-nav',
  templateUrl: './nav.component.html',
  styleUrls: ['./nav.component.css']
})
export class NavComponent implements OnInit {

  appTitle = "ParulUni";

  constructor() { }

  ngOnInit(): void {
  }

  getTitle() {
    return this.appTitle;
  }
}
<!-- Navbar -->
<nav class="navbar fixed-top navbar-expand-lg navbar-dark custom-primary-bg-color">
  <div class="container-fluid">
    <a class="navbar-brand" href="#"><strong>{{ getTitle() }}</strong></a>
    <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent"
      aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
      <span class="navbar-toggler-icon"></span>
    </button>
    <div class="collapse navbar-collapse" id="navbarSupportedContent">
      <ul class="navbar-nav me-auto mb-2 mb-lg-0">
        <li class="nav-item">
          <a class="nav-link" aria-current="page" routerLinkActive="active" routerLink="/list">Contact List</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" routerLink="/add">Add New Contact</a>
        </li>
      </ul>
    </div>
  </div>
</nav>
<!-- Navbar -->
